I find its quite easy to get a c++ version following the python code, i create a gist https://gist.github.com/argman/f378b5020e2ec7e2b621dcd1bf2f61f7 to help others
usage:
1. you should compile onnx's lib and dll to include onnx_pb.h
2. load model
   `onnx::ModelProto model;
   std::ifstream in(modelPath, std::ios_base::binary);
	model.ParseFromIstream(&in);
	in.close();`
3. extract sub model 
`onnx::ModelProto subModel = Extractor(model).ExtractModel({"input_name"}, {"output_name"});
	std::string subModelString = subModel.SerializeAsString();`
4. runing use onnx-runtime
`Ort::Session session(env, subModelString.data(), subModelString.size(), sessionOptions);`
